query:
MATCH 
  (trex:Dinosaur {name: "Tyrannosaurus"}),
  (trex)-[ld:LIVED_DURING]->(when:Period),
  (trex)-[li:LIVED_IN]->(where),
  (trex)-[mo:MEMBER_OF]->(group)

RETURN *

